let docClient = new AWS.DynamoDB.DocumentClient();

const LOWER_RANDOM = 100000;
const UPPER_RANDOM = 999999;
const MESES_ANIO = "12";
const CUPON_ANIO = "DONT-STOP-BELIEVING";
const CUPON_NATACION = "NATACIONFREE";
const CUPON_WATERPOLO = "WATERPOLO50";
const DISCIPLINA_NATACION = "natacion";
const DISCIPLINA_WATERPOLO = "waterpolo";
const HASH_KEY_MEMBRESIA = "membresia";
const SIN_CUPON = "no le gustan los descuentos eh?";
const MENSAJE_CONFIRMACION = "¡Estás a punto de inscribirte al mejor gimnasio! ¿Tus datos son correctos?";
const TITULO_CONFIRMACION = "¡Atención valioso cliente!";
const MENSAJE_ALERT_DE_SPEECH = "Puedes navegar entre secciones mencionando su nombre ¡Inténtalo!";
const TITULO_ALERT_DE_SPEECH = "¡Bienvenido!";
const NOMBRE_ARCHIVO = "aqua-gym.pdf";
const GENERATE_FROM_CORDOVA = true;

let cupon = "";
let disciplina = "";
let telefono = "";
let nombre = "";
let apellidos = "";
let email = "";
let fechaNacimiento = "";
let calle = "";
let numCasa = "";
let colonia = "";
let cp = "";
let grupo = "";
let totalMeses = "";
let folio = "";
let fechaPago = "";
let cantidadPago = 0;
let mensualidad = 0;
let precioMembresia = 0;
let descuento = 0;
let instrucciones = "";
let nombreInstructor = "";
let apellidoInstructor = "";
let horario = "";

function obtenerGruposHorarios() {
    _buscarInstructoresPorDisciplina()
        .then(function (data) {
            if (data.Items === undefined) {
                return Promise.reject("No se encontraron los instructores");
            } else {
                let mapa = {};
                data.Items.forEach(function (instructor) {
                    mapa[instructor.grupo] = instructor.info.horario;
                });
                return Promise.resolve(mapa);
            }
        })
        .then(function (mapa) {
            console.log(mapa);
            rellenaHorarios(mapa);
        })
        .catch(function (err) {
            console.log(err);
        });
}

function _buscarInstructoresPorDisciplina() {
    _obtenerValorDisciplina();
    let params = {
        TableName: "Instructor",
        KeyConditionExpression: "disciplina = :disc",
        ExpressionAttributeValues: {
            ":disc": disciplina
        }
    };

    return docClient.query(params).promise();
}

function validarPromo() {
    _obtenerValorCupon();
    _obtenerValorTotalMeses();
    _obtenerValorDisciplina();

    _buscarPromo()
        .then(function (data) {
            if (data === SIN_CUPON) {
                console.log("No se aplico cupon");
                return Promise.resolve(true);
            } else if (data.Item === undefined) {
                console.log("La promocion no se encontro");
                return Promise.resolve(false);
            } else {
                console.log("Se obtuvo la promocion: " + "\n" + JSON.stringify(data, undefined, 2));
                if (new Date() >= new Date(data.Item.caducidad)) {
                    console.log("Promocion caduco");
                    return Promise.resolve(false);
                }
                switch (data.Item.codigo) {
                    case CUPON_ANIO:
                        return Promise.resolve(totalMeses === MESES_ANIO);
                    case CUPON_NATACION:
                        return Promise.resolve(disciplina === DISCIPLINA_NATACION);
                    case CUPON_WATERPOLO:
                        return Promise.resolve(disciplina === DISCIPLINA_WATERPOLO);
                    default:
                        return Promise.resolve(true);
                }
            }
        })
        .then(function (cuponValido) {
            console.log(cuponValido);
            verificaInputCupon(cuponValido);
        })
        .catch(function (err) {
            console.log("No se pudo obtener promocion: " + "\n" + JSON.stringify(err, undefined, 2));
        });
}

function registrar() {
    if (confirm(MENSAJE_CONFIRMACION)) {
        let now = new Date();
        _obtenerValores(now);
        _crearInscripcion()
            .then(_obtenerMembresia)
            .then(function (data) {
                console.log("Se obtuvo la membresia: " + "\n" + JSON.stringify(data, undefined, 2));
                precioMembresia = data.Item.precio;
            })
            .then(_obtenerDisciplina)
            .then(function (data) {
                console.log("Se obtuvo la disciplina: " + "\n" + JSON.stringify(data, undefined, 2));
                mensualidad = data.Item.mensualidad;
            })
            .then(_buscarPromo)
            .then(function (data) {
                if (data === SIN_CUPON) {
                    console.log("No se aplico cupon");
                    cantidadPago = precioMembresia + (mensualidad * totalMeses);
                } else {
                    console.log("Se obtuvo la promocion: " + "\n" + JSON.stringify(data, undefined, 2));
                    descuento = data.Item.descuento;
                    instrucciones = data.Item.instrucciones;
                    cantidadPago = _aplicarPromo();
                }
            })
            .then(_crearPago)
            .then(_obtenerInstructor)
            .then(function (data) {
                console.log("Se obtuvo el instructor: " + "\n" + JSON.stringify(data, undefined, 2));
                nombreInstructor = data.Item.info.nombre;
                apellidoInstructor = data.Item.info.apellido;
                horario = data.Item.info.horario;

                let pdf = _generarPDF(now);
                pdf.save(NOMBRE_ARCHIVO);
            })
            .catch(function (err) {
                console.log(err);
            });
    }
}

function registrarCordova() {
    navigator.notification.confirm(MENSAJE_CONFIRMACION, confirmCallback, TITULO_CONFIRMACION, ['Sí', 'Déjame revisar']);

    function confirmCallback(buttonIndex) {
        if(buttonIndex == 1) {
            let now = new Date();
            _obtenerValores(now);
            _crearInscripcion()
                .then(_obtenerMembresia)
                .then(function (data) {
                    console.log("Se obtuvo la membresia: " + "\n" + JSON.stringify(data, undefined, 2));
                    precioMembresia = data.Item.precio;
                })
                .then(_obtenerDisciplina)
                .then(function (data) {
                    console.log("Se obtuvo la disciplina: " + "\n" + JSON.stringify(data, undefined, 2));
                    mensualidad = data.Item.mensualidad;
                })
                .then(_buscarPromo)
                .then(function (data) {
                    if (data === SIN_CUPON) {
                        console.log("No se aplico cupon");
                        cantidadPago = precioMembresia + (mensualidad * totalMeses);
                    } else {
                        console.log("Se obtuvo la promocion: " + "\n" + JSON.stringify(data, undefined, 2));
                        descuento = data.Item.descuento;
                        instrucciones = data.Item.instrucciones;
                        cantidadPago = _aplicarPromo();
                    }
                })
                .then(_crearPago)
                .then(_obtenerInstructor)
                .then(function (data) {
                    console.log("Se obtuvo el instructor: " + "\n" + JSON.stringify(data, undefined, 2));
                    nombreInstructor = data.Item.info.nombre;
                    apellidoInstructor = data.Item.info.apellido;
                    horario = data.Item.info.horario;

                    _guardarPDFCordova(now);
                })
                .catch(function (err) {
                    console.log(err);
                });
        }
    }
}

function _obtenerValorCupon() {
    cupon = document.getElementById("inputCupon").value.toString();
}

function _obtenerValorDisciplina() {
    disciplina = document.getElementById("select_disciplina").value.toString();
}

function _obtenerValorTotalMeses() {
    totalMeses = document.getElementById("select_meses").value.toString();
}

function _buscarPromo() {
    if (cupon) {
        let params = {
            TableName: "Promociones",
            Key: {
                "codigo": cupon
            }
        };
        return docClient.get(params).promise();
    } else {
        return Promise.resolve(SIN_CUPON);
    }
}

function _obtenerValores(now) {
    _obtenerValorCupon();
    _obtenerValorDisciplina();
    _obtenerValorTotalMeses();
    telefono = document.getElementById("inputPhone").value.toString();
    nombre = document.getElementById("inputName").value.toString();
    apellidos = document.getElementById("inputLastname").value.toString();
    email = document.getElementById("inputEmail").value.toString();
    fechaNacimiento = document.getElementById("inputf_nac").value.toString();
    calle = document.getElementById("inputCalle").value.toString();
    numCasa = document.getElementById("inputNumcasa").value.toString();
    colonia = document.getElementById("inputColonia").value.toString();
    cp = document.getElementById("inputCP").value.toString();
    grupo = document.getElementById("select_horario").value.toString();
    fechaPago = `${now.getFullYear()}/${now.getMonth() + 1}/${now.getDate()}-${now.getHours()}:${now.getMinutes()}:${now.getSeconds()}`;
    folio = `${fechaPago}-${_getRandomIntInclusive(LOWER_RANDOM, UPPER_RANDOM)}`;
}

function _crearInscripcion() {
    let params = {
        TableName: "Inscripcion",
        Item: {
            "disciplina": disciplina,
            "telefono": telefono,
            "info": {
                "nombre": nombre,
                "apellidos": apellidos,
                "email": email,
                "fecha_nacimiento": fechaNacimiento,
                "calle": calle,
                "numero": numCasa,
                "colonia": colonia,
                "cp": cp,
                "grupo": grupo,
                "total_meses": totalMeses,
                "folio": folio
            }
        }
    };
    return docClient.put(params).promise();
}

function _crearPago() {
    let params = {
        TableName: "Pagos",
        Item: {
            "folio": folio,
            "fecha": fechaPago,
            "cantidad": cantidadPago
        }
    };
    return docClient.put(params).promise();
}

function _obtenerMembresia() {
    let params = {
        TableName: "Disciplina",
        Key: {
            "nombre": HASH_KEY_MEMBRESIA
        }
    };
    return docClient.get(params).promise();
}

function _obtenerDisciplina() {
    let params = {
        TableName: "Disciplina",
        Key: {
            "nombre": disciplina
        }
    };
    return docClient.get(params).promise();
}

function _aplicarPromo() {
    if (cupon === CUPON_ANIO) {
        return precioMembresia + (mensualidad * descuento);
    } else {
        let temp = precioMembresia + (mensualidad * totalMeses);
        return temp * descuento;
    }
}

function _obtenerInstructor() {
    let params = {
        TableName: "Instructor",
        Key: {
            "disciplina": disciplina,
            "grupo": grupo
        }
    };
    return docClient.get(params).promise();
}

function _getRandomIntInclusive(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function _addDays(date, days) {
    let result = new Date(date);
    result.setDate(result.getDate() + days);
    return result;
}

